    "#Loading all packages and datasets we'll need for this homework\n",
    "library(tidyverse) # metapackage of all tidyverse packages\n",
    "library(tree)\n",
    "library(rpart)\n",
    "library(factoextra)\n",
    "library(randomForest)\n",
    "library(GGally)\n",
    "\n",
    "uscrime <- read.table(\"../input/week4/week 4 data-summer/data 9.1/uscrime.txt\", header = TRUE, sep = \"\", check.names=FALSE)\n"
   ]
