   "source": [
    "#Using the first four/five PCs, let's now build a linear regressional model\n",
    "\n",
    "uscrimePCA5 <- cbind(pca_crime5, uscrime[,16])\n",
    "uscrimePCA4 <- cbind(pca_crime4, uscrime[,16])\n",
    "\n",
    "#uscrimePCA5\n",
    "#uscrimePCA4\n",
    "\n",
    "modelPCA5 <- lm(V6~., data = as.data.frame(uscrimePCA5))\n",
    "modelPCA4 <- lm(V5~., data = as.data.frame(uscrimePCA4))\n",
    "\n",
    "summary(modelPCA5)\n",
    "summary(modelPCA4)"
   ]
  },
