   "source": [
    "# coefficients for PCA linear regression\n",
    "beta5 <- modelPCA5$coefficients[1]\n",
    "betas5 <- modelPCA5$coefficients[2:6]\n",
    "\n",
    "beta4 <- modelPCA4$coefficients[1]\n",
    "betas4 <- modelPCA4$coefficients[2:5]\n",
    "\n",
    "# transformation\n",
    "alphas5 <- pca_crime$rotation[,1:5] %*% betas5\n",
    "alphas4 <- pca_crime$rotation[,1:4] %*% betas4\n",
    "\n",
    "t(alphas5) # scaled data coefficients\n",
    "t(alphas4)\n",
    "\n",
    "#To obtain the coefficients of the unscaled data:\n",
    "alphas_unscaled5 <- alphas5/sapply(uscrime[,1:15],sd)\n",
    "alphas_unscaled4 <- alphas4/sapply(uscrime[,1:15],sd)\n",
    "\n",
    "beta_unscaled5 <- beta5 - sum(alphas5 * sapply(uscrime[,1:15],mean)/sapply(uscrime[,1:15],sd))\n",
    "beta_unscaled4 <- beta4 - sum(alphas4 * sapply(uscrime[,1:15],mean)/sapply(uscrime[,1:15],sd))\n",
    "\n",
    "# coefficients for unscaled data\n",
    "t(alphas_unscaled5)\n",
    "t(alphas_unscaled4)\n",
    "\n",
    "beta_unscaled5\n",
    "beta_unscaled4\n",
    "\n",
    "#We can obtain the estimate of our unscaled data\n",
    "\n",
    "est5 <- as.matrix(uscrime[,1:15]) %*% alphas_unscaled5 + beta_unscaled5\n",
    "est4 <- as.matrix(uscrime[,1:15]) %*% alphas_unscaled4 + beta_unscaled4\n",
    "\n",
    "est5\n",
    "est4"
   ]
  },
