    "SSE5 = sum((est5-uscrime[,16])^2)\n",
    "SST5 = sum((uscrime[,16]-mean(uscrime[,16]))^2)\n",
    "Rsquared5 <- 1 - SSE5/SST5 # R-squared\n",
    "Rsquaredadj5 <- Rsquared5 - (1-Rsquared5)*4/(nrow(uscrime)-5-1) # adjusted R-squared\n",
    "\n",
    "SSE4 = sum((est4-uscrime[,16])^2)\n",
    "SST4 = sum((uscrime[,16]-mean(uscrime[,16]))^2)\n",
    "Rsquared4 <- 1 - SSE4/SST4 # R-squared\n",
    "Rsquaredadj4 <- Rsquared4 - (1-Rsquared4)*4/(nrow(uscrime)-4-1) # adjusted R-squared\n",
    "\n",
    "Rsquared5\n",
    "Rsquaredadj5\n",
