   "source": [
    "Both the R-squared and adjusted R-squared values are lower for the linear regressional model with PCA than the one without (at least for 4 and 5 principal components) which indicates that the linear regression model with PCA is worse than the linear regression model without PCA at least for the model useing the first five principal components. The formula for our PCA model (in terms of the original variables) is thus Crime = -5933.84 + 48.37 (M =14) + 79.02 (So = 0) + 17.83 (Ed = 10.0) + 39.48 (Po1 = 12.0) + 39.86 (Po2 = 15.5) +1886.95(LF = 0.640) + 36.69 (M.F = 94.0) + 1.55 (Pop = 150) + 9.54 (NW = 1.1) + 159.01 (U1 = 0.120) + 38.3 (U2 = 3.6) + 0.037 (Wealth = 3200) + 5.54 (Ineq = 20.1) - 1523.52 (Prob = 0.04) + 3.84 (Time = 39.0) which equates to a crime rate of ~1393.81"
