   "source": [
    "# Plot our standard deviation vs number of branches to see if we are overfitting model by having 4 nodes. By inspecting the evolution of training errors and node size, we are able to identify whwere the training error stops going down with the # of nodes and then increases upwards, the lowest point is where we need to stop training to avoid overfitting which appears to be 3 nodes. Clearly there is a case of overfitting going on in the model as shown by the jump up for 4 nodes.\n",
    "plot(cv.crime$size, cv.crime$dev, type = \"b\")"
   ]
