   "source": [
    "# Calculate quality of fit for pruned vs original model\n",
    "crimeTreePredict1 <- predict(tree_model1, data = crime.train[,1:15])\n",
    "RSS <- sum((crimeTreePredict1 - crime.train[,16])^2)\n",
    "TSS <- sum((crime.train[,16] - mean(crime.train[,16]))^2)\n",
    "R2 <- 1 - RSS/TSS\n",
    "R2\n",
    "\n",
    "pruned_crimeTreePredict1 <- predict(pruned_treemodel1, data = crime.train[,1:15])\n",
    "RSS <- sum((pruned_crimeTreePredict1 - crime.train[,16])^2)\n",
    "TSS <- sum((crime.train[,16] - mean(crime.train[,16]))^2)\n",
    "pruned_R2 <- 1 - RSS/TSS\n",
    "pruned_R2"
   ]
  },
