   "source": [
    "We can see from the above that both our original regression tree model and pruned regression tree model are not siginificant as r-squared is 0.68 and 0.60 respectively. While graphs seem to indicate we're overfitting with 3 nodes, R-squared has dropped significantly when we reduce our number to 2 nodes. Let's try running our model on the validation set to see how they perform."
