   "source": [
    "R-sqaured compares the fit of the chosen model with that of a horizontal straight line (the null hypothesis). If the chosen model fits worse than a horizontal line, then r-squared is negative. So clearly, our model is not good as r-squared is negative only when the chosen model does not follow the trend of the data, so it fits worse than a horizontal line. This most likely due to the small number of data points we have to create a model. The tree model is overfit to the training data and is thus not following the trend of the overall data set resulting in a poor model. Datasets with large numbers of records are better for statistical analysis as the statistical soundness of results increases as the number of observations increases."
   ]
