    "#(b) randomForest model. Set importance to true to assess the importance of predictors. Default values for nodesize are 1 for classification and 5 for regression.\n",
    "set.seed(10)\n",
    "crime_rf <- randomForest(Crime ~ ., data=crime.train, importance = TRUE)\n",
    "crime_rf_predict <- predict(crime_rf, data=crime.train[,-16])\n",
    "TSS <- sum((crime.train[,16] - mean(crime.train[,16]))^2)\n",
    "RSS <- sum((crime_rf_predict - crime.train[,16])^2)\n",
    "R2 <- 1 - RSS/TSS\n",
    "R2"
   ]
