   "source": [
    "set.seed(8)\n",
    "result_rf <- data.frame(matrix(nrow=5, ncol=2))\n",
    "colnames(result_rf) <- c(\"NodeSize\", \"R2\")\n",
    "i = 1\n",
    "suppressWarnings(for (nodesize in 2:15) {\n",
    "    model <- randomForest(Crime ~ ., data=crime.train, importance = TRUE, nodesize = nodesize)\n",
    "    predict <- predict(model, data=crime.train[,-16])\n",
    "    RSS <- sum((predict - crime.train[,16])^2)\n",
    "    TSS <- sum((crime.train[,16] - mean(crime.train[,16]))^2)\n",
    "    R2 <- 1 - RSS/TSS\n",
    "    result_rf[i,1] <- nodesize\n",
    "    result_rf[i,2] <- R2\n",
    "    i = i + 1\n",
    "})\n",
    "head(result_rf)\n",
    "\n",
    "#return the node size with the best R-squared\n",
    "result_rf[which.max(result_rf[,2]),]"
   ]
  },
