   "source": [
    "#Let's now test on our test data set to see what R-squared we come up with\n",
    "rf_valid <- predict(best_rf, data = crime.train[,1:15])\n",
    "RSS <- sum((rf_valid - crime.valid[,16])^2)\n",
    "TSS <- sum((crime.valid[,16] - mean(crime.valid[,16]))^2)\n",
    "R2 <- 1 - RSS/TSS\n",
    "R2"
   ]
  },
