   "source": [
    "Based on the above, the maximum R-squared for our training set was 0.11 (statistically insignificant) with a nodesize of 4. We also saw in the best rf model that Prob, Po1, and Po2 were the most important as measured by “%IncMSE”. However, on our validation set R-squared was once again negative which means that the chosen model fits worse than a horizontal line. Clearly the randomForest model performed worse than the tree model, but I think this can largely be attributed to overfitting due to the small number of points in the dataset and the fact we are not dealing with normally distributed data."
   ]
