   "source": [
    "## Question 10.2\n",
    "### Describe a situation or problem from your job, everyday life, current events, etc., for which a logistic regression model would be appropriate. List some (up to 5) predictors that you might use."
   ]
  },
  {
   "cell_type": "markdown",
   "id": "5830f5c8",
   "metadata": {
    "papermill": {
     "duration": 0.040124,
     "end_time": "2022-07-08T14:08:31.313584",
     "exception": false,
     "start_time": "2022-07-08T14:08:31.273460",
     "status": "completed"
    },
    "tags": []
   },
   "source": [
    "When purchasing a product that’s being offered as a “great deal” from a vendor, the procurement team in my supply chain company must think about additional factors besides simply price to determine if the purchase of a product is truly worth our time. Some of the factors that go into this “yes” or “no” decision in reserve slot impact (do we have enough room in our distribution centers to hold the product), DOH for this type of product (how long does it stay in the distribution center before we can get it to retail; determines if product moves fast enough), number of units (if the amount we’re being asked to purchase is anything less than 10 days of supply we typically don’t move forward in buying), price (both to us and what we can turn around and charge retail for the product), and current supply (are we already carrying something similar in our warehouse that we need to get out to retail).\n",
    "Again, these are just several factors that go into purchasing decisions, but you can see how important they are in determining a probability that we should indeed purchase a “good deal” from a vendor or not."
   ]
  },
