    "\n",
    "decredit_train$V4A42[decredit_train$V4 == \"A42\"] <- 1\n",
    "decredit_train$V4A42[decredit_train$V4 != \"A42\"] <- 0\n",
    "\n",
    "decredit_train$V4A43[decredit_train$V4 == \"A43\"] <- 1\n",
    "decredit_train$V4A43[decredit_train$V4 != \"A43\"] <- 0\n",
    "\n",
    "decredit_train$V6A65[decredit_train$V6 == \"A65\"] <- 1\n",
