    "\n",
    "decredit_train$V10A103[decredit_train$V10 == \"A103\"] <- 1\n",
    "decredit_train$V10A103[decredit_train$V10 != \"A103\"] <- 0\n",
    "\n",
    "log_reg2 <- glm(V21 ~ V1A13 + V1A14 +V2 + V3A34 + V4A41 + V4A42+ V4A43 +V6A65 + V8 + V10A103, data = decredit_train, family=binomial(link=\"logit\"))\n",
