   "source": [
    "With no threshhold, accuracy (proprotion of true results in the population) is ~74% and specificity (proportion of true negatives correctly identified) for the model is ~87%. While this is isn't bad, we must remember that incorrectly identifying a bad customer as good, is 5 times worse than incorrectly classifying a good customer as bad. Thus, we need to make sure our specificity is more accurate than 87% as the cost of allowing those 13% incorrectly classified customers through is very high!"
